import React from 'react';
import body from './body.css'
import { TileLayout } from "@progress/kendo-react-layout";


class Body extends React.Component {

buildTiles = (props) => {
    <div className="tile">
    <h3>{props.title}</h3>
    <p>{props.description}</p>
    <button>Learn more</button>
  </div>
}

tilesData = [
    {
        defaultPosition: {
          col: 1,
          colSpan: 1,
          rowSpan: 1,
        },
        header: "Tile 1",
        body: <p>Reorderable tile.</p>,
      },
      {
        defaultPosition: {
          col: 2,
          colSpan: 1,
          rowSpan: 1,
        },
        header: "Tile 2",
        body: <p>Reorderable tile.</p>,
      },
      {
        defaultPosition: {
          col: 3,
          colSpan: 1,
          rowSpan: 1,
        },
        header: "Tile 3",
        body: <p>Non-reorderable.</p>,
        reorderable: false,
      },
  ];

      render() {
        return (

<>
<TileLayout
      columns={3}
      rowHeight={200}
      gap={{
        rows: 10,
        columns: 10,
      }}
      items={this.tilesData}/>
</>
    );
}
}
export default Body;
